class Solution:
    def updateMatrix(self, matrix):
        # BFS
        ans = [[0]*len(matrix[0]) for _ in range(len(matrix))]
        for x in range(len(matrix)):
            for y in range(len(matrix[0])):
                if matrix[x][y] == 0:
                    n = 0
                else:
                    tmp_m = [[0]*len(matrix[0]) for _ in range(len(matrix))]
                    tmp_m[x][y] = -1
                    n = self.bfs(1, [-1], (x,y), matrix, tmp_m)
                ans[x][y] = n
        return ans

    def bfs(self, n, dq, site, matrix, tmp_m):

        for dx,dy in [(1,0),(0,-1,),(-1,0),(0,1)]:
            nx = site[0]+dx
            ny = site[1]+dy
            if  0 <= nx < len(matrix) and  0 <= ny < len(matrix[0]) and tmp_m[nx][ny] != -1: 
                if matrix[nx][ny] == 0: 
                    return n
                else:
                    matrix[nx][ny] = -1
                    dq.append((nx, ny))

        site = dq.pop(0)
        if site == -1 and dq:
            dq.append(-1)
            site = dq.pop(0)
            n += 1
        return self.bfs(n, dq, site, matrix, tmp_m)

